import React from 'react';
import Login from './pages/Login/login.js';
import './App.css'
import { BrowserRouter as Router,Route,Routes } from 'react-router-dom';


function App() {
  return (
    <Routes>
      <Router>
        <Route exact path="/" element={<Login></Login>}></Route>
      </Router>
    </Routes>
  );
}

export default App;
